export default function BatteryLifeResource () {
    return <div>
        <h2>Battery Life</h2>
        <p>The operating system (OS) plays a crucial role in managing the resources of a device to extend its battery life. One of the primary ways it does this is by optimising the usage of the Central Processing Unit (CPU). The CPU is the heart of any device and consumes a significant amount of power.</p>
    </div>
}
